import React from 'react';
import '../App'
import '../css/footer.css'

class Footer extends React.Component {
    render() {
        return (
        <footer className='footer'>
            <div className="footer-content">
                <ul className="socials">
                
                    <li><a href="https://www.facebook.com/Acoustic-Live-105974658569772" target="_BLANK"><i className="fab fa-facebook-f"></i></a></li>
                    <li><a href="https://www.instagram.com/acoustic_live2021/" target="_BLANK"><i className="fab fa-instagram"></i></a></li>
                    <li><a href="https://twitter.com/acoustic_live21" target="_BLANK"><i className="fab fa-twitter"></i></a></li>
                </ul>
                <h6 className="text-light">Powered by CodeMasters</h6> 
            </div>
        </footer>
        );
    }
}

export default Footer;
